import React from "react";
import { FaHeartbeat, FaDumbbell, FaLungs, FaNotesMedical } from "react-icons/fa";
import { useNavigate } from "react-router-dom";
import "./Dashboard.css";

const exercises = [
  {
    title: "Chair Squats",
    condition: "Cardiac Rehab",
    icon: <FaHeartbeat size={40} color="#ff6b6b" />,
    description: "Strengthens leg muscles without strain on the heart.",
    route: "/exercise/chair-squats",
  },
  {
    title: "Arm Circles",
    condition: "Orthopedic Rehab",
    icon: <FaDumbbell size={40} color="#6c5ce7" />,
    description: "Improves shoulder mobility and blood circulation.",
    route: "/exercise/arm-circles",
  },
  {
    title: "Marching in Place",
    condition: "Cardiac Rehab",
    icon: <FaLungs size={40} color="#00b894" />,
    description: "Boosts heart rate in a controlled, low-impact manner.",
    route: "/exercise/marching",
  },
  {
    title: "Leg Extensions",
    condition: "Physiotherapy",
    icon: <FaNotesMedical size={40} color="#0984e3" />,
    description: "Strengthens knee joints and thigh muscles.",
    route: "/exercise/leg-extensions",
  },
];

const Dashboard = () => {
  const navigate = useNavigate();

  return (
    <div className="dashboard">
      <header className="header">
        <h1>AI Rehab Dashboard</h1>
      </header>

      <div className="main-content">
        {exercises.map((exercise, index) => (
          <div
            key={index}
            className="card"
            title={exercise.description} // native tooltip
          >
            <div className="icon">{exercise.icon}</div>
            <h2>{exercise.title}</h2>
            <p className="label">{exercise.condition}</p>
            <button className="start-button" onClick={() => navigate(exercise.route)}>
              Start
            </button>
          </div>
        ))}

        <div className="card helper-card" title="Helpful Physiotherapy tips and safety reminders">
          <div className="icon">
            <FaNotesMedical size={40} color="#fdcb6e" />
          </div>
          <h2>Physiotherapy Guide</h2>
          <p className="label">Helpful Info</p>
          <button className="start-button" onClick={() => alert("Coming soon!")}>
            Learn
          </button>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
